  `},{id:"masque-visage-nila-bleu",name:"Masque Visage Nila Bleu",img:"/images/soin13.webp",description:"Ce masque apporte une expérience rafraîchissante à votre routine de soin de la peau. Enrichi en extraits naturels de Nila Bleu, riche en antioxydants et en nutriments essentiels, notre masque revitalise la peau, l'hydratant en profondeur et lui offrant un éclat naturel. Sa formule douce et onctueuse glisse sur la peau, procurant une sensation apaisante et revitalisante.",ingredients:"Aqua/Eau, Nila bleu, Sorbitol, Huile d’avocat, Cetyl alcohol, Ceteareth- 20, Phenoxyethanol, Propylene glycol, Caprylyl caprylate, Citric acid.",bienfaits:["Éclaircissement du teint:La poudre de Nila Bleu contient des composés naturels qui aident à inhiber la production de mélanine, le pigment responsable de la couleur de la peau. En réduisant la production de mélanine, la poudre de Nila Bleu permet de rendre le teint plus clair et lumineux.","Réduction des taches sombres:Grâce à ses propriétés régulatrices de mélanine, la poudre de Nila Bleu peut aider à réduire l’apparence de ces taches et à uniformiser le teint.","Unification du teint:En plus d’éclaircir le teint et de réduire les taches sombres, la poudre de Nila Bleu peut également améliorer l’aspect général de la peau en unifiant sa couleur et en estompant les imperfections.","Effets anti-âge: La poudre de Nila Bleu possède également des propriétés anti-âge. Elle aide à réduire les ridules et à donner à la peau un aspect plus ferme et rajeuni.","Hydratation et adoucissement de la peau: Sa formule hydratante naturelle adoucit la peau et réduit les taches sombres, laissant la peau douce et hydratée."],utilisation:`

