  `},{id:"masque-visage-charbon-actif",name:"Masque Visage Charbon Actif",img:"/images/soin14.webp",description:"Plongez dans une expérience de soin luxueuse avec notre Masque Visage au Charbon Actif, spécialement formulé pour détoxifier et revitaliser votre peau. Ce masque combine les propriétés purifiantes du charbon actif naturel avec des extraits botaniques nourrissants, offrant une solution complète pour une peau éclatante et impeccable.",ingredients:"Aqua/Eau, Cetyl Alcohol, Ceteareth-20, Phenoxythanol, Caprylic, Vitamine B3.",bienfaits:["Purification Intense : Le charbon actif agit comme un aimant pour attirer et absorber les impuretés, le sébum excessif et les toxines, laissant votre peau nettoyée en profondeur.","Rafraîchissement Instantané : Enrichi en extraits de plantes revitalisants, ce masque rafraîchit instantanément votre teint, réduisant les signes de fatigue et de stress cutané.","Hydratation Profonde : Sa formule unique contient des agents hydratants qui nourrissent intensément la peau, lui redonnant souplesse et douceur.","Réduction des Imperfections :Grâce à ses propriétés purifiantes, le masque aide à minimiser l’apparence des pores dilatés et des imperfections, pour une peau plus lisse et uniforme."],utilisation:`

